//以上是echart插件
$(function() {
	var data = {
		type: url('?type'),
		p_id: url('?p_id'),
		day: url('?day')
	}
	requestUrl('http://115.29.196.61/api/get_data_four', 'GET', data, function(data) {
		var area = [], value = [];
		for (var i = 0; i < data.length; i++) {
			area.push(data[i].AREA);
			value.push(data[i].value);
		}
		area.unshift(0);
		value.unshift(0);
		area.push(0);
		value.push(0);
		var type = url('?type');
		if (type == 1) name = '下订单数';
		if (type == 2) name = '取消订单数';
		if (type == 3) name = '下订单金额';
		if (type == 4) name = '取消订单金额';
		//柱状图显示
	    var bigBarChart = echarts.init(document.getElementById('bigBarChart'));
	    var optionBigBar = {
	    	title: {
	    		text: '单品区域统计'
	    	},
	        grid: {
	            left: '5%',
	            right: '5%'
	        },
	        tooltip: {
	            trigger: 'axis',
	            position: function (pt) {
	                return [pt[0], '10%'];
	            }
	        },
	        xAxis: {
	            type: 'category',
	            boundaryGap: false,
	            data: area
	        },
	        yAxis: {
	            type: 'value',
	            boundaryGap: [0, '100%']
	        },
	        dataZoom: [{
	            type: 'inside',
	            disabled: true
	        }],
	        series: [{
	                name: name,
	                type: 'bar',
	                silent: true,
	                data: value
	            }]
	    };
	    bigBarChart.setOption(optionBigBar)
	})
	
})